def draw_picture(true, pred, str, dic):
    """
    :param true: 真实值
    :param pred: 预测值
    :param str: 标题
    :return:
    """
    plt.clf()
    true = true.cpu()
    pred = pred.cpu()
    # sequence_len = 50
    sequence_len = true.shape[1]
    # y1 = true[0, :50, 0].view(-1)
    # y2 = pred[0, :50, 1].view(-1)
    y1 = true[0, :sequence_len, 0].view(-1)
    y2 = pred[0, :sequence_len, 0].view(-1)
    y1 = y1.detach().numpy()
    y2 = y2.detach().numpy()
    listA = y1.tolist()
    listB = y2.tolist()
    f = open(dic + "data.csv", 'a', newline='')
    writer = csv.writer(f)
    writer.writerow([str+dic+'true']+listA)
    writer.writerow([str + dic + 'pred'] + listB)
    f.close()

    x = [i for i in range(sequence_len)]
    plt.figure(figsize=(6, 5))
    #plt.grid(linestyle="--")  # 设置背景网格线为虚线
    ax = plt.gca()

    plt.plot(x, y1, color='red', linewidth=1.5, label='True')
    plt.plot(x, y2, color="blue", linewidth=1.5, label='Pred')
    #plt.xticks(x, group_labels, fontsize=12, fontweight='bold')  # 默认字体大小为10
    #plt.yticks([])
    #plt.title("true pred", fontsize=12, fontweight='bold')  # 默认字体大小为12
    plt.tick_params(labelsize=18)  # 调整坐标轴数字大小
    plt.xlabel("Time", fontsize=18, fontweight='bold')
    plt.ylabel("Value", fontsize=18, fontweight='bold')
    # plt.xlim(0, 3)  # 设置x轴的范围
    # plt.ylim(0.2, 1.2)
    plt.legend(loc=0, numpoints=1)
    leg = plt.gca().get_legend()
    ltext = leg.get_texts()

    plt.setp(ltext, fontsize=18, fontweight='bold')  # 设置图例字体的大小和粗细

    plt.savefig('figure/' + dic + '/' + str + '.jpg', bbox_inches='tight')
    plt.savefig('figure/' + dic + '/' + str + '.pdf', bbox_inches='tight')
    plt.cla()
    #plt.show()

