def draw_picture_all(true, pred, trend, seasonal, str, dic):
    """
    :param true: 真实值
    :param pred: 预测值
    :param str: 标题
    :return:
    """
    plt.clf()
    true = true.cpu()
    pred = pred.cpu()
    trend = trend.cpu()
    seasonal = seasonal.cpu()
    temp = true[:, 0:48, :]
    pred = torch.cat([temp, pred[:, 48:, :]], dim=1)
    trend = torch.cat([temp, trend[:, 48:, :]], dim=1)
    seasonal = torch.cat([temp, seasonal[:, 48:, :]], dim=1)

    # sequence_len = 50
    sequence_len = true.shape[1]
    # y1 = true[0, :50, 0].view(-1)
    # y2 = pred[0, :50, 1].view(-1)
    y1 = true[0, :sequence_len, 4].view(-1)
    y2 = pred[0, :sequence_len, 4].view(-1)
    y3 = trend[0, :sequence_len, 4].view(-1)
    y4 = seasonal[0, :sequence_len, 4].view(-1)
    y1 = y1.detach().numpy()
    y2 = y2.detach().numpy()
    y3 = y3.detach().numpy()
    y4 = y4.detach().numpy()
    # data = pd.read_csv('data.csv', index_col=0)
    # datasets.to_csv('data.csv')

    x = [i for i in range(sequence_len)]
    plt.figure(figsize=(10, 8))
    #plt.grid(linestyle="--")  # 设置背景网格线为虚线
    ax = plt.gca()

    plt.plot(x, y3, color='#FF8C00', linewidth=1.5, label='trend')
    plt.plot(x, y4, color="#228B22", linewidth=1.5, label='seasonl')
    # plt.plot(x, y2, color="blue", linewidth=1.5, label='pred')
    plt.plot(x, y1, color='red', linewidth=1.5, label='true')
    plt.axvline(47, c='#00BFFF', ls='--')

    #plt.xticks(x, group_labels, fontsize=12, fontweight='bold')  # 默认字体大小为10
    #plt.yticks([])
    #plt.title("true pred", fontsize=12, fontweight='bold')  # 默认字体大小为12
    #plt.xlabel("pred_len", fontsize=13, fontweight='bold')
    #plt.ylabel("MSE", fontsize=13, fontweight='bold')
    #plt.xlim(0, 3)  # 设置x轴的范围
    #plt.ylim(0.2, 1.2)
    plt.legend(loc=4, numpoints=1)
    leg = plt.gca().get_legend()
    ltext = leg.get_texts()

    plt.setp(ltext, fontsize=12, fontweight='bold')  # 设置图例字体的大小和粗细

    plt.savefig('figure/' + dic + '/' + str + '.jpg')
    plt.savefig('figure/' + dic + '/' + str + '.pdf')
    plt.cla()


